import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

export default function Main() {
  const navigate = useNavigate();

  // Styles pour les boutons du menu
  const menuButton = {
    backgroundColor: "#2c3e50",
    color: "#ecf0f1",
    border: "none",
    padding: "10px 15px",
    fontSize: "16px",
    borderRadius: "6px",
    marginBottom: "10px",
    cursor: "pointer",
    width: "200px",
    textAlign: "left",
  };

  // Etats pour la recherche h√¥tels
  const [destination, setDestination] = useState("Tunisie");
  const [arrival, setArrival] = useState("");
  const [departure, setDeparture] = useState("");
  const [adults, setAdults] = useState(2);
  const [children, setChildren] = useState(0);
  const [rooms, setRooms] = useState(1);

  const handleSearch = () => {
    console.log({
      destination,
      arrival,
      departure,
      adults,
      children,
      rooms,
    });
    // Logique de recherche ou navigation
    navigate("/user/search");
  };

  return (
    <div style={{ display: "flex", minHeight: "100vh" }}>
      {/* Sidebar Menu */}
      <div style={{ width: "220px", padding: "20px", backgroundColor: "#34495e" }}>
        <h2
          style={{
            marginBottom: "30px",
            borderBottom: "2px solid #2980b9",
            paddingBottom: "10px",
            color: "#ecf0f1",
          }}
        >
          Menu Utilisateur
        </h2>

        <button
          style={menuButton}
          onClick={() => navigate("/user")}
          onMouseEnter={(e) => (e.target.style.backgroundColor = "#2980b9")}
          onMouseLeave={(e) => (e.target.style.backgroundColor = "#2c3e50")}
        >
          üè† Accueil
        </button>

        <button
          style={menuButton}
          onClick={() => navigate("/user/search")}
          onMouseEnter={(e) => (e.target.style.backgroundColor = "#2980b9")}
          onMouseLeave={(e) => (e.target.style.backgroundColor = "#2c3e50")}
        >
          üîç Recherche H√¥tels
        </button>

        <button
          style={menuButton}
          onClick={() => navigate("/reports/Reports")}
          onMouseEnter={(e) => (e.target.style.backgroundColor = "#2980b9")}
          onMouseLeave={(e) => (e.target.style.backgroundColor = "#2c3e50")}
        >
          üìä Rapport
        </button>

        <button
          style={menuButton}
          onClick={() => navigate("/user/profile")}
          onMouseEnter={(e) => (e.target.style.backgroundColor = "#2980b9")}
          onMouseLeave={(e) => (e.target.style.backgroundColor = "#2c3e50")}
        >
          üë§ Profil
        </button>

        <button
          style={menuButton}
          onClick={() => navigate("/user/bookings")}
          onMouseEnter={(e) => (e.target.style.backgroundColor = "#2980b9")}
          onMouseLeave={(e) => (e.target.style.backgroundColor = "#2c3e50")}
        >
          üìÖ R√©servations
        </button>

        <button
          style={menuButton}
          onClick={() => navigate("/user/favorites")}
          onMouseEnter={(e) => (e.target.style.backgroundColor = "#2980b9")}
          onMouseLeave={(e) => (e.target.style.backgroundColor = "#2c3e50")}
        >
          ‚≠ê Favoris
        </button>

        <button
          style={menuButton}
          onClick={() => navigate("/user/contact")}
          onMouseEnter={(e) => (e.target.style.backgroundColor = "#2980b9")}
          onMouseLeave={(e) => (e.target.style.backgroundColor = "#2c3e50")}
        >
          üìû Contact
        </button>

        <button
          style={menuButton}
          onClick={() => navigate("/user/help")}
          onMouseEnter={(e) => (e.target.style.backgroundColor = "#2980b9")}
          onMouseLeave={(e) => (e.target.style.backgroundColor = "#2c3e50")}
        >
          ‚ùì Aide / FAQ
        </button>

        <button
          style={menuButton}
          onClick={() => navigate("/user/settings")}
          onMouseEnter={(e) => (e.target.style.backgroundColor = "#2980b9")}
          onMouseLeave={(e) => (e.target.style.backgroundColor = "#2c3e50")}
        >
          ‚öôÔ∏è Param√®tres
        </button>

        <button
          style={menuButton}
          onClick={() => {
            localStorage.removeItem("token");
            navigate("/login");
          }}
          onMouseEnter={(e) => (e.target.style.backgroundColor = "#c0392b")}
          onMouseLeave={(e) => (e.target.style.backgroundColor = "#2c3e50")}
        >
          üîì D√©connexion
        </button>
      </div>

      {/* Contenu principal : Bloc Recherche */}
      <div style={{ flex: 1, padding: "50px" }}>
        <h1>H√¥tels en Tunisie</h1>
        <p>Indiquez vos dates et faites votre choix parmi des milliers d'h√¥tels !</p>

        <div style={{ display: "flex", gap: "10px", marginTop: "30px", flexWrap: "wrap" }}>
          <input
            type="text"
            value={destination}
            onChange={(e) => setDestination(e.target.value)}
            placeholder="Destination"
          />
          <input
            type="date"
            value={arrival}
            onChange={(e) => setArrival(e.target.value)}
          />
          <input
            type="date"
            value={departure}
            onChange={(e) => setDeparture(e.target.value)}
          />
          <input
            type="number"
            value={adults}
            onChange={(e) => setAdults(e.target.value)}
            min="1"
            placeholder="Adultes"
          />
          <input
            type="number"
            value={children}
            onChange={(e) => setChildren(e.target.value)}
            min="0"
            placeholder="Enfants"
          />
          <input
            type="number"
            value={rooms}
            onChange={(e) => setRooms(e.target.value)}
            min="1"
            placeholder="Chambres"
          />
          <button onClick={handleSearch} style={{ padding: "10px 20px", backgroundColor: "#2980b9", color: "#fff", border: "none", borderRadius: "6px" }}>
            Rechercher
          </button>
        </div>
      </div>
    </div>
  );
}
